import React from 'react';
import {Card,Col} from 'react-bootstrap';
import '../App.css';

const PersonCard = props => {
    return (
        <Card className = "cardLayout">
            <Card.Body>
                <Card.Title>{props.name}</Card.Title>
                <Col xs ={3}>
                <h5>Logo</h5>
                </Col>
                <Col>
                <h1>Logo2</h1>
                </Col>
            </Card.Body>
        </Card>
    );
}

export default PersonCard;
